(B) LIBRARY CONSTRUCTION
The library was generated using Nugen''s The Encore NGS Library System I
This workflow was as follows:

(1) Double-stranded DNA is fragmented using Adaptive Focused Acoustics (Covaris) to produce fragments with 150200 base pairs size distribution; (2) The ends of the DNA fragments are then repaired to generate blunt ends with 5 phosphates and 3 hydroxyls; (3) Adaptor molecules, with optional indexing tags provided in the Encore NGS Multiplex Systems, are ligated to the 5 and 3 end of each fragment; and (4) Fragments with ligated adaptor sequences are amplified to produce the final library.

